import React from 'react';
import {connect} from "react-redux"

const reviewForm=(props)=>(
  <div>
    <h1>Data</h1>
    <p>{props.data.landlord_bio.name}</p>
  </div>
)

const mapStateToProps=(state)=>{
  return{
    data: state.app 
  }
}
export default connect(mapStateToProps)(reviewForm)
